        private _asyncGetCall(url): Promise<any> {
            return new Promise((resolve, reject) => {
                $.ajaxSetup({
                    crossDomain: true,
                    xhrFields: {
                        withCredentials: true,
                        cache: true
                    },
                });

                $.get(url).done((response) => {
                    resolve(response);
                }).fail((err) => {
                    reject(Error(err.toString()));
                });
            });
        }

