        public getIncidentLookupTable(): Promise<IncidentLookupTable> {
            return new Promise((resolve, reject) => {
                this._getIncididentLookupJson()
                    .then((lookupJson) => {
                        var inciArray: Array<Incident> = [];
                        if (lookupJson.status != "success") {
                            reject(Error("error in getIncididentLookupJson"));
                        }

                        var length = lookupJson.reasons.length;
                        for (var i = 0; i < length; ++i) {
                            var reason: Incident = lookupJson.reasons[i];
                            inciArray.push(reason);
                        }

                        var inciTable: IncidentLookupTable = new IncidentLookupTable(inciArray);
                        resolve(inciTable);
                    });
            });
        }
    
        // todo: Test on DC with multiple tickets
        public getIcmTickets(dcName: string): Promise<Array<IcmTicket>> {
            return new Promise((resolve, reject) => {
                this._getIcmTicketJson(dcName)
                    .then((icmJson) => {
                        var ticketArr: Array<IcmTicket> = [];
                        if (icmJson.status != "success") {
                            reject(Error("getIcmTicketJson"));
                        }

                        for (var key in icmJson.tickets) {
                            if (!icmJson.hasOwnProperty(key)) { // metadata and not useful
                                continue;
                            }

                            var ticketArrayJson = icmJson[key];
                            var length = ticketArrayJson.length;
                            for (var i = 0; i < length; ++i) {
                                ticketArr.push(new IcmTicket(ticketArrayJson[i]));
                            }
                        }

                        resolve(ticketArr);
                    });
            });
        }
    
        // get the mstickets for a given datacenter
        public getMsTickets(dcId: number, dcName: string): Promise<Array<MsTicket>> {
            return new Promise((resolve, reject) => {
                this._getMsTicketJson(dcId)
                    .then((ticketsJson) => {
                        var msTickets: Array<MsTicket> = [];
                        var length = ticketJson.length;
                        for (var i = 0; i < length; ++i) {
                            var ticketJson = ticketsJson[i];

                            var created: Date = ParseDate(ticketJson.Created);
                            var modified: Date = ParseDate(ticketJson.Modified);
                            var groupId: string = ticketJson.ExternalReferenceId.toUpperCase();
                            var ticket: MsTicket = new MsTicket(created, modified,
                                ticketJson.TeamAssignedName, ticketJson.TicketId, dcId, dcName,
                                ticketJson.CreatedBy, groupId, ticketJson.Title, ticketJson.Status);

                            msTickets.push(ticket);
                        }

                        resolve(msTickets);
                    });
            });
        }
    
