        // implements GetDiscreteReservationsAtDatacenter
        public getDiscreteReservations(dcId: number): Promise<Array<DiscreteReservation>> {
            return new Promise((resolve, reject) => {
                this.getDiscreteReservationsJson(dcId)
                    .then((discretesByColo) => {
                        var discretes: Array<DiscreteReservation> = [];
                        for (var key in discretesByColo) {
                            if (!discretesByColo.hasOwnProperty(key)) { // metadata and not reservation
                                continue;
                            }
                            var coloName: string = key;
                            var discretesInColo: Array<DiscreteReservation> = this.getDiscreteReservationsFromColo(discretesByColo[coloName], coloName, dcId);
                            discretes = discretes.concat(discretesInColo);
                        }

                        return discretes;
                    });
            });
        }
    
        // takes in weird json data
        // Only processes data, doesn't need to be async
        public getDiscreteReservationsFromColo(coloData: any, coloName: string, dcId: number): Array<DiscreteReservation> {
            var discreteArray: Array<DiscreteReservation> = [];
            for (var key in coloData) { // loop through each reservation name as a key
                if (!coloData.hasOwnProperty(key)) { // metadata and not reservation
                    continue;
                }
                var discRes: DiscreteReservation;
                discRes._rackName = key;
                discRes._coloName = coloName;
                discRes._dcId = dcId;
                discRes._devices = this._getDiscreteDevicesByReservation(coloData[discRes._rackName]);

                discreteArray.push(discRes);
            }

            return discreteArray;
        }
    
        // takes in weird json data
        // Only processes data, doesn't need to be async
        private _getDiscreteDevicesByReservation(reservationData: any): Array<DiscreteDevice> {
            var deviceArr: Array<DiscreteDevice> = [];
            for (var key in reservationData) { // loop through each reservation name as a key
                if (!reservationData.hasOwnProperty(key)) { // metadata and not meant for processing
                    continue;
                }

                var device: DiscreteDevice;
                var deviceId = key;
                var deviceJson = reservationData[deviceId];
                device._reservationId = parseInt(deviceId);
                device._orderId = deviceJson.OrderId;
                device._groupId = deviceJson.GroupId;
                device._slot = deviceJson.S;
                device._deviceType = deviceJson.T;
                device._uCount = deviceJson.U;
                device._assetTag = deviceJson.Tg;
                device._year = deviceJson.Yr;
                device._month = deviceJson.Mn;
                device._watts = deviceJson.P;
                device._propertyGroup = deviceJson.PG;

                deviceArr.push(device);
            }

            return deviceArr;
        }
    
        // get buildings for a given DC
