        public getBuildingCoordinates(coloId: number, coloName: string): Promise<BuildingCoordinates> {
            var canvasItemProp: CanvasItemProp;
            canvasItemProp.MasterId = coloId.toString();
            canvasItemProp.Name = coloName;

            return new Promise((resolve, reject) => {
                this.getCurrentDatacenter()
                    .then((currDc) => {
                        return this.getSketchCanvasItems(currDc.id, currDc.name, [canvasItemProp]);
                    })
                    .then((canvasItems) => {
                        var targetItems = canvasItems.filter((item) => item.MCoID == coloId);
                        if (!targetItems.length) { // we don't have coordinates for this colo
                            return null;
                        }

                        resolve(targetItems[0]);
                    });
            });
        }

