    // converts Epoch to Human
    function EpochToHuman(inputtext) {
        if (inputtext.charAt(inputtext.length - 1) == "L") {
            inputtext = inputtext.slice(0, -1);
        }
        inputtext = inputtext * 1; // convert to number
        var epoch = inputtext;
        if (inputtext >= 100000000000000) {
            epoch = Math.round(inputtext / 1000000);
            inputtext = Math.round(inputtext / 1000);
        } else if (inputtext >= 100000000000) {
            epoch = Math.floor(inputtext / 1000);
        } else {
            inputtext = (inputtext * 1000);
        }
        var datum = new Date(inputtext);
        return datum;
    }

    // converts date of form /Date(1397654117440+0000)/
    // converst date of form /Date(1397654117440)/
    // to js date object
    function ParseDate(dateString) {

        // conatains plus
        if (dateString.indexOf('+') > -1) {
            dateString = dateString.split('(')[1]; // snip off beginning of string
            dateString = dateString.split('+')[0]; // snip off end of string, now we have 1397654117440
        }
        else {
            dateString = dateString.split('(')[1]; // snip off beginning of string
            dateString = dateString.split(')')[0]; // snip off end of string, now we have 1397654117440
        }

        return EpochToHuman(dateString);
    }
